import React from "react";

function ProfilePage() {
  // You can get the username from JWT if you decode it, or pass it as prop if you want
  const username = "user"; // replace with actual logic if desired

  return (
    <div style={{
      minWidth: 340,
      maxWidth: 420,
      background: "#fff",
      borderRadius: 18,
      padding: "32px 34px",
      boxShadow: "0 4px 20px rgba(107, 70, 193, 0.10)",
      margin: "auto"
    }}>
      <h2 style={{color:"#6b46c1", marginBottom:10}}>Profile</h2>
      <hr style={{marginBottom:24}} />
      <div style={{fontSize:"1.18rem", marginBottom:18}}><strong>Username:</strong> {username}</div>
      <div style={{color:"#888", fontSize:"1.04rem", marginBottom:26}}>Account settings and info coming soon!</div>
      <button style={{
        background:"#6b46c1",
        color:"#fff",
        border:"none",
        borderRadius:7,
        padding:"8px 22px",
        fontWeight:600,
        fontSize:"1rem",
        cursor:"pointer"
      }}>
        Edit Profile
      </button>
    </div>
  );
}

export default ProfilePage;
